selector_to_html = {"a[href=\"#web-account-users\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Web Account Users<a class=\"headerlink\" href=\"#web-account-users\" title=\"Link to this heading\">#</a></h1><h2>View Details<a class=\"headerlink\" href=\"#view-details\" title=\"Link to this heading\">#</a></h2><h3>Web Account Detail Tab<a class=\"headerlink\" href=\"#web-account-detail-tab\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id2\"]": "<figure class=\"align-default\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../_images/Link_To_User.png\"><img alt=\"../../_images/Link_To_User.png\" src=\"../../_images/Link_To_User.png\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Link to User</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#web-account-detail-tab\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Web Account Detail Tab<a class=\"headerlink\" href=\"#web-account-detail-tab\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#assign-to-companies\"]": "<figure class=\"align-default\" id=\"assign-to-companies\">\n<a class=\"reference internal image-reference\" href=\"../../_images/Assign_To_Companies.png\"><img alt=\"../../_images/Assign_To_Companies.png\" src=\"../../_images/Assign_To_Companies.png\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Assign To Companies</span><a class=\"headerlink\" href=\"#assign-to-companies\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#accounts-linked-tab\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Accounts Linked Tab<a class=\"headerlink\" href=\"#accounts-linked-tab\" title=\"Link to this heading\">#</a></h3><h4>Link To User<a class=\"headerlink\" href=\"#link-to-user\" title=\"Link to this heading\">#</a></h4>", "a[href=\"#id1\"]": "<figure class=\"align-default\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../_images/Web_Account_Users.png\"><img alt=\"../../_images/Web_Account_Users.png\" src=\"../../_images/Web_Account_Users.png\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Web Account Users</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#view-details\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">View Details<a class=\"headerlink\" href=\"#view-details\" title=\"Link to this heading\">#</a></h2><h3>Web Account Detail Tab<a class=\"headerlink\" href=\"#web-account-detail-tab\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#web-account-details\"]": "<figure class=\"align-default\" id=\"web-account-details\">\n<a class=\"reference internal image-reference\" href=\"../../_images/Web_Account_Detail.png\"><img alt=\"../../_images/Web_Account_Detail.png\" src=\"../../_images/Web_Account_Detail.png\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Web Account Details</span><a class=\"headerlink\" href=\"#web-account-details\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#accounts-linked\"]": "<figure class=\"align-default\" id=\"accounts-linked\">\n<a class=\"reference internal image-reference\" href=\"../../_images/Accounts_Linked.png\"><img alt=\"../../_images/Accounts_Linked.png\" src=\"../../_images/Accounts_Linked.png\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Accounts Linked</span><a class=\"headerlink\" href=\"#accounts-linked\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#link-to-user\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Link To User<a class=\"headerlink\" href=\"#link-to-user\" title=\"Link to this heading\">#</a></h4>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false, theme: 'material', duration: [200, 100], delay: [200, 500],

            });
        };
    };
    console.log("tippy tips loaded!");
};
